import React from 'react';
import '../../../App.css';
import styles from "./staff.module.css"
import List from '../../../components/list/list';
import StaffCard from '../../../components/staff-card/staff-card';

const Staff = (props) => {
    const { data } = props
    return (
        <div>
            <section id={styles.sec1}>
                <div className="container">
                    <a href={item.port} className="portfolios">
                    <div className={styles.sec1_content}>
                        <List
                            items={data}
                            renderItem={(item) => (
                                <StaffCard
                                    {...item}
                                    key={item.id}
                                />
                            )}
                        />
                    </div>
                    </a>

                </div>
            </section>
        </div>

    );
}

export default Staff;
